package dao.vendor;

public class Vendor {

	int venId;
	String venName;
	String venLocation;
	String venAddress;
	String venSpoc;
	String venPhone;
	String venEmail;
	
	
	
	public int getVenId() {
		return venId;
	}
	public void setVenId(int venId) {
		this.venId = venId;
	}
	public String getVenName() {
		return venName;
	}
	public void setVenName(String venName) {
		this.venName = venName;
	}
	public String getVenLocation() {
		return venLocation;
	}
	public void setVenLocation(String venLocation) {
		this.venLocation = venLocation;
	}
	public String getVenAddress() {
		return venAddress;
	}
	public void setVenAddress(String venAddress) {
		this.venAddress = venAddress;
	}
	public String getVenSpoc() {
		return venSpoc;
	}
	public void setVenSpoc(String venSpoc) {
		this.venSpoc = venSpoc;
	}
	public String getVenPhone() {
		return venPhone;
	}
	public void setVenPhone(String venPhone) {
		this.venPhone = venPhone;
	}
	public String getVenEmail() {
		return venEmail;
	}
	public void setVenEmail(String venEmail) {
		this.venEmail = venEmail;
	}
}
